TableSqlTransformation.SqlQuery:
/*Widgets actions*/ SELECT DISTINCT t.[_id] AS Id, t.dashboardid, Upper(t.[widget_id]) AS WidgetID, t.actiontype, d.eckey, t.DashUser, d.DashOwner, (t.dashboardid +'|' + Upper(t.[widget_id]) ) AS Dash_Widget FROM [trace] t LEFT JOIN [dashboards] d ON t.DashboardId = d.DashboardId WHERE url LIKE '%widget%' --AND IsNullOrEmpty(d.eckey) = false UNION ALL /*View Dashboard actions*/ SELECT DISTINCT tt.[_id], tt.dashboardid, Upper([widgets].widgetid) AS WidgetID, actiontype, d.eckey, tt.DashUser, d.DashOwner, tt.dashboardid + '|' + CASE WHEN IsNullOrEmpty(widgetid)= false THEN Upper(widgetid) ELSE '' END AS Dash_widget FROM (SELECT DISTINCT t.[_id], t.dashboardid, t.actiontype, t.DashUser FROM [trace] t WHERE url LIKE '%dashboard%' AND url NOT LIKE '%widget%' ) tt LEFT JOIN [widgets] ON tt.dashboardid = widgets.DashboardId LEFT JOIN [dashboards] d ON tt.dashboardid = d.DashboardId --WHERE IsNullOrEmpty(d.eckey) = false UNION ALL
/*Edit / Add / delete dashboard actions*/ SELECT DISTINCT t.[_id], t.dashboardid, Upper(t.[widget_id]), t.actiontype, d.eckey, t.DashUser, d.DashOwner, (t.dashboardid + '|' + Upper(t.[widget_id])) AS Dash_Widget FROM [trace] t LEFT JOIN [dashboards] d ON t.dashboardid = d.DashboardId WHERE url LIKE 'dashboard%' AND url NOT LIKE '%widget%' --AND IsNullOrEmpty(d.eckey) = false
UNION ALL /*Dashboard_Shares*/ SELECT DISTINCT s.[_id], s.DashboardId, '' AS widget_id, 'SHARE' AS actiontype, d.eckey, s.DashUser, s.DashOwner, (s.DashboardId ) AS Dash_Widget FROM [DASHBOARD_SHARES] s LEFT JOIN [dashboards] d ON s.dashboardid = d.DashboardId --WHERE IsNullOrEmpty(d.eckey) = false
